import React from 'react';
import styles from './Search.module.scss';
const Search = ({ search, setSearch }) => {
	return (
		<>
			<input
				className={styles.search}
				value={search}
				onChange={(e) => setSearch(e.target.value)}
				type='text'
				placeholder='Поиск'
			/>
		</>
	);
};

export default Search;
